import React from 'react';
import Footer from './Footer';
import Navbar from './Navbar';
import Slider from './Slider1';
import About from './About';
import List1 from './List1';
import Title from './Title';
const Home1 = () => {
  return <div>
      <div><Slider /></div>
      <div><Title /></div>
      <div><List1 /></div>
      <div><About /></div>
      <div><Footer /></div>

  </div>;
};

export default Home1;
